import React from 'react';
import '../utils/style/ContactUs.css';
import Banner4 from './Banners/Banner4';

function ContactUs (){
	return (
		<div id="contact">
			<Banner4 />
			<div>
				<h2 className='contact__title'>Rejoignez-nous</h2>
			</div>
			<div  id="collectif">

				<div className='contact__container'>
					<p className='contact__text'>Si notre projet vous intéresse, que vous souhaitez nous rejoindre ou simplement recevoir plus d'innformation :	</p>							

					<p></p><a href="mailto:contact@telemaque.eu"> Envoyez-nous un message </a>


				</div>
			</div>
		</div>
	)
}

export default ContactUs
